    if (t < 2) {
        $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, MaximumAmplitude), Math.sin($bm_mul($bm_mul($bm_mul(Frequency, t), 2), Math.PI))), Math.exp($bm_mul(Decay, t))));
    } else {
        $bm_rt = value;
    }
} else {
    $bm_rt = value;
}

